// src/GitHubCalendar.js
import React from 'react';
import GitHubCalendar from 'react-github-calendar';

const MyGitHubCalendar = () => {
  return (
    <div>
      <h1>My GitHub Contribution Calendar</h1>
      <GitHubCalendar
        username="your-github-username" // Replace with your GitHub username
        blockSize={15} // Size of each block
        blockMargin={5} // Margin between blocks
        color="#7bc96f" // Color of the blocks
        fontSize={16} // Font size for the text
      />
    </div>
  );
};

export default MyGitHubCalendar;
